        return(
            <HeaderWrapper>
                <img src="https://i.imgur.com/SOaMg6w.png" height={64} width={100}></img>
            <HeaderList>
              <LogoText></LogoText>
                  
              </HeaderList>

            </HeaderWrapper>
        )
    }
}
export default Header;
